import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { 
  AppBar, 
  Toolbar, 
  Typography, 
  Button, 
  IconButton, 
  Menu, 
  MenuItem, 
  Avatar, 
  Box,
  Chip,
  Badge
} from '@mui/material';
import { 
  AccountCircle, 
  Dashboard, 
  Leaderboard, 
  ExitToApp,
  Notifications,
  Settings,
  Help
} from '@mui/icons-material';
import { logoutUser } from '../../store/authSlice';
import { getRank } from '../../utils/helpers';

const Header = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const dispatch = useDispatch();
  const { user, isAuthenticated } = useSelector(state => state.auth);
  const { userProgress } = useSelector(state => state.challenges);

  const [anchorEl, setAnchorEl] = useState(null);
  const [notificationAnchor, setNotificationAnchor] = useState(null);
  const open = Boolean(anchorEl);
  const notificationOpen = Boolean(notificationAnchor);

  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleNotificationMenu = (event) => {
    setNotificationAnchor(event.currentTarget);
  };

  const handleNotificationClose = () => {
    setNotificationAnchor(null);
  };

  const handleLogout = () => {
    dispatch(logoutUser());
    handleClose();
    navigate('/');
  };

  const isActivePath = (path) => {
    return location.pathname === path;
  };

  return (
    <AppBar position="static" sx={{ background: 'linear-gradient(135deg, #0cc0df, #007acc)' }}>
      <Toolbar>
        {/* Logo */}
        <Typography 
          variant="h6" 
          component="div" 
          sx={{ cursor: 'pointer', fontWeight: 'bold' }}
          onClick={() => navigate('/')}
        >
          Aurora Rising
        </Typography>

        {/* Navigation Links */}
        {isAuthenticated && (
          <Box sx={{ display: 'flex', gap: 2, ml: 4 }}>
            <Button 
              color="inherit" 
              onClick={() => navigate('/dashboard')}
              sx={{ 
                fontWeight: isActivePath('/dashboard') ? 'bold' : 'normal',
                backgroundColor: isActivePath('/dashboard') ? 'rgba(255,255,255,0.1)' : 'transparent'
              }}
            >
              Dashboard
            </Button>
            <Button 
              color="inherit" 
              onClick={() => navigate('/leaderboard')}
              sx={{ 
                fontWeight: isActivePath('/leaderboard') ? 'bold' : 'normal',
                backgroundColor: isActivePath('/leaderboard') ? 'rgba(255,255,255,0.1)' : 'transparent'
              }}
            >
              Leaderboard
            </Button>
          </Box>
        )}

        {/* Spacer */}
        <Box sx={{ flexGrow: 1 }} />

        {/* User Menu */}
        {isAuthenticated ? (
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            {/* User Rank Chip */}
            {userProgress && (
              <Chip
                label={getRank(userProgress?.challengesCompleted || 0, userProgress?.totalScore || 0)}
                size="small"
                sx={{
                  backgroundColor: 'rgba(255,255,255,0.2)',
                  color: 'white',
                  fontWeight: 'bold'
                }}
              />
            )}

            {/* Notifications */}
            <IconButton
              size="large"
              aria-label="notifications"
              onClick={handleNotificationMenu}
              color="inherit"
            >
              <Badge badgeContent={0} color="error">
                <Notifications />
              </Badge>
            </IconButton>

            {/* User Avatar and Menu */}
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleMenu}
              color="inherit"
            >
              <Avatar sx={{ bgcolor: 'rgba(255,255,255,0.2)' }}>
                {user?.username?.charAt(0)?.toUpperCase()}
              </Avatar>
            </IconButton>

            {/* User Menu */}
            <Menu
              id="menu-appbar"
              anchorEl={anchorEl}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={open}
              onClose={handleClose}
            >
              <MenuItem onClick={() => { navigate('/profile'); handleClose(); }}>
                <AccountCircle sx={{ mr: 1 }} />
                Profile
              </MenuItem>
              <MenuItem onClick={() => { navigate('/dashboard'); handleClose(); }}>
                <Dashboard sx={{ mr: 1 }} />
                Dashboard
              </MenuItem>
              <MenuItem onClick={() => { navigate('/leaderboard'); handleClose(); }}>
                <Leaderboard sx={{ mr: 1 }} />
                Leaderboard
              </MenuItem>
              <MenuItem onClick={() => { navigate('/settings'); handleClose(); }}>
                <Settings sx={{ mr: 1 }} />
                Settings
              </MenuItem>
              <MenuItem onClick={() => { navigate('/help'); handleClose(); }}>
                <Help sx={{ mr: 1 }} />
                Help
              </MenuItem>
              <MenuItem onClick={handleLogout}>
                <ExitToApp sx={{ mr: 1 }} />
                Logout
              </MenuItem>
            </Menu>

            {/* Notifications Menu */}
            <Menu
              id="notification-menu"
              anchorEl={notificationAnchor}
              open={notificationOpen}
              onClose={handleNotificationClose}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
            >
              <MenuItem onClick={handleNotificationClose}>
                <Typography variant="body2" color="text.secondary">
                  No new notifications
                </Typography>
              </MenuItem>
            </Menu>
          </Box>
        ) : (
          <Button color="inherit" onClick={() => navigate('/')}>
            Login
          </Button>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Header;
